import * as React from 'react';

export const WorldwideCard: React.FC<{}> = () => {
  return (
    <div
      style={{ fontFamily: 'airbnb-book' }}
      className='w-1/3 flex flex-col items-center'>
      <div>
        <h3 className='text-6xl text-gray-850'>2.9M</h3>
      </div>
      <div>
        <p className='text-gray-750'>Hosts on Airbnb</p>
      </div>
    </div>
  );
};
